import React from "react";
import Fab from '@mui/material/Fab';
import AddIcon from '@mui/icons-material/Add';
function InputArea(){
    return <div className="InputAreaDiv">
        <input placeholder="Enter title here"></input>
        <textarea placeholder="Enter Description Here" rows="3"></textarea>
        <Fab color="black" aria-label="add">
  <AddIcon />
</Fab>
        {/* <button>ADD</button> */}
    </div>
}
export default InputArea;
